DROP TABLE IF EXISTS `qdii`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `qdii` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `fund_id` varchar(100) NOT NULL COMMENT '代码',
  `fund_nm` varchar(100) NOT NULL COMMENT '名称',
  `price` varchar(100) NOT NULL COMMENT '价格',
  `increase_rt` varchar(100) NOT NULL COMMENT '涨幅',
  `volume` varchar(100) NOT NULL COMMENT '成交(万元)',
  `amount` varchar(100) NOT NULL COMMENT '场内份额(万份)',
  `amount_incr` varchar(100) NOT NULL COMMENT '场内新增(万份)',
  `fund_nav` varchar(100) NOT NULL COMMENT '净值',
  `nav_dt` varchar(100) NOT NULL COMMENT '净值日期',
  `estimate_value` varchar(100) NOT NULL COMMENT 'T-1估值',
  `ref_increase_rt` varchar(100) NOT NULL COMMENT '指数涨幅',
  `est_val_dt` varchar(100) NOT NULL COMMENT '估值日期',
  `est_val_increase_rt` varchar(100) NOT NULL COMMENT '估值涨幅',
  `discount_rt` varchar(100) NOT NULL COMMENT '溢价率',
  `index_nm` varchar(100) NOT NULL COMMENT '相关标的',
  `apply_fee` varchar(100) NOT NULL COMMENT '申购费',
  `redeem_fee` varchar(100) NOT NULL COMMENT '赎回费',
  `turnover_rt` varchar(100) NOT NULL COMMENT '换手率',
  `last_est_datetime` varchar(100) NOT NULL COMMENT '日期',
  `update_time` int(11) NOT NULL COMMENT '更新日期',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=172 DEFAULT CHARSET=utf8 COMMENT='qdii';
/*!40101 SET character_set_client = @saved_cs_client */;

